def binary_search_rotated(data, search_num):
    low = 1
    high = len(data) - 1
    while low <= high:
        mid = (low + high) // 2
        if data[mid] == search_num:
            return mid
        elif data[mid] >= data[low]:
            if search_num >= data[low] and search_num <= data[mid]:
                high = mid - 1
            else:
                low = mid + 1
        elif search_num >= data[mid] and search_num <= data[high]:
            low = mid + 1
        else:
            high = mid - 1
    return -1

